function longestConsecutiveLength(array) {
  if (array.length < 2) {
    return array.length;
  }
  array.sort((a,b) => (a - b));
  let count = 1;
  let maxCount = 1;
  for (i=0; i<array.length-1; i++) {
    if (1 === array[i+1] - array[i]) {
      count++;
    } else if (array[i]!==array[i+1]) {
      maxCount = Math.max(maxCount, count);
      count = 1;
    }
  }
  maxCount = Math.max(maxCount, count);
  return maxCount;
}

